    fetch('https://api.openweathermap.org/data/2.5/weather?q={city name}&appid=https://api.openweathermap.org/data/2.5/weather?q=london&appid=')
    .then ((response) => response.json())
    .then((json) => console.log(json))
  }

  return (
    <>
 <Search_bar />
 <button onClick={apiGet} />

